full_text:
@FallGuysGame @timthetatman #Timthebeatthesenselessshitoutofadevertisement

#lolz
How to kill a game.

@FallGuysGame @timthetatman YOOOO!  BIG QUESTION!

Can we up the level cap from 40 to something way higher to keep us playing with more purpose?

Cannot wait for season 2!

@FallGuysGame @timthetatman Season 1: 40 Levels, 7 of them where with kudos (19500), 3 crowns.

So, basically, 10 out of 30 where just some "bored" stuff.

If Season 2 is 20 crowns, maybe 5 will be with Kudos (15k?) and it will still only be 40 levels, we will only get 15 new items? (down from 30)?

@FallGuysGame @timthetatman Do you also have plans for additional uses for kudo's? 
I mean... players can buy them with real money, but even if you don't spend extra money and just play a lot... you end up with a lot of kudo's that go unused since there 'is no use'. 
-sitting on 200k kudo's earned-

@FallGuysGame @timthetatman Awesome! I have been hoarding my crowns cause idk when I’ll win more lol. 

Can you say anything about stats tracking? Win % per level, # of games played, victories?

can you somehow manage to reduce the number of times we play the same games? Mix it up? Ala Mario Kart 8 online?

